import * as React from 'react'
import { allTaxa, Taxon, TaxonCode, taxonLevel } from './alltaxa'
import { taxonFullName } from './TaxaForm';

interface ScoringTaxonToPrint {
	code:     TaxonCode,
	codeName: string,
	name:     string,
	scoreStr: string,
}

const printTaxa = (name:string, taxa: ScoringTaxonToPrint[]) => {
	const debug = false;
	return (
		<div>
			{/* <h2>{name}</h2> */}
			{debug &&
				<div><h3>Confirm correct</h3> {
					taxa.map((tx) => {
						return <p key={'confirm_' + name + tx.code}>
							{`${tx.name} => ${tx.code} => ${tx.codeName}`}
						</p>
					})
				}</div>
			}

			{/* <h3>New format for {name}</h3> */}
			<p>export const {name} = new Map([</p>
			{
				taxa.map((tx) => (
					<span key={'new'+name+tx.code}><br/>{`[ "${tx.code}", { ${tx.scoreStr} } ],   // ${tx.codeName}`}</span>
				))
			}
			<span><br/>])</span>
		</div>
	)
}

