const PsiFamCodes: React.SFC<{}> = () => {
	const errs:any = [];
	const psiCodedTaxa: ScoringTaxonToPrint[] = psiFam.map((taxon) => {
		const tx = Array.from(allTaxa.entries()) .find((testTx) => {
			return (testTx[1].major_group === taxon.class_order
				||  testTx[1].major_group === taxon.suborder_superfamily
				||  taxon.class_order === taxon.family)
				&& (testTx[1].family === taxon.family
				||  testTx[1].major_group === taxon.family);
		}) as [TaxonCode, Taxon]

		if (tx === undefined) {
			hasErrs = true;
			errs.push(taxon);
			return { code: '', codeName: '', name: '', scoreStr: '', }
		}

		const name     = taxon.class_order + ' ' + taxon.suborder_superfamily + ' ' + taxon.family;
		const info     = tx[1];
		const codeName = `${info.major_group} ${info.family}`;
		const scoreStr = `fssr:"${taxon.fssr}"`;

		return { scoreStr, name, code: tx[0], codeName };
	})

	return (<div>
		<h2>PSI errors</h2>
		{errs.map((err:any) => (<div>{err.class_order} {err.suborder_superfamily} {err.family}</div>))}
		{printTaxa('scoresPsiFamily', psiCodedTaxa)}
	</div>)
}

const PsiSpcCodes: React.SFC<{}> = () => {
	const errs:any = [];
	const psiCodedTaxa: ScoringTaxonToPrint[] = psiSpecies.map((taxon) => {
		const taxa = Array.from(allTaxa.entries());
		const isGenus = taxon.species === "sp.";
		const txCheck = (testTx: [TaxonCode, Taxon]): boolean => (
			   testTx[1].family === taxon.family
			&& (testTx[1].genus                === taxon.genus
			 || testTx[1].genus.split(' ')[0]  === taxon.genus
			 || testTx[1].genus                === taxon.genus.split(' ')[0])
			&& ((!isGenus && testTx[1].species === taxon.species)
			    || (isGenus && testTx[1].species === '' && taxonLevel(testTx[0]) === 'genus'))
		)

		const tx = taxa .find((testTx) => (txCheck(testTx))) as [TaxonCode, Taxon]

		const matches = taxa.filter((testTx) => ( txCheck(testTx) ))
		const matchCount = matches.length

		if (tx === undefined || matchCount !== 1) {
			hasErrs = true;
			errs.push(taxon);
			// { throw new Error("invalid taxon"); }
			return { code: '', codeName: '', name: '', scoreStr: '', }
		}

		const name     = taxon.major_group + ' ' + taxon.family + ' ' + taxon.genus + ' ' + taxon.species
		const info     = tx[1];
		const codeName = `${info.major_group} ${info.family} ${info.genus} ${info.species}`;
		const scoreStr = `fssr:"${taxon.fssr}"`;

		return { scoreStr, name, code: tx[0], codeName };
	})

	return (<div>
		<h2>PSI errors</h2>
		{errs.map((err:any) => (<div>{err.major_group} {err.family} {err.genus} {err.species}</div>))}
		{printTaxa('scoresPsiSpecies', psiCodedTaxa)}
	</div>)
}

